import React from "react";

const PreviewComponent = ({ title, items }) => {
  return (
    <div className="preview-component">
      <h1>{title}</h1>
      {items
        .filter((item, idx) => idx < 4)
        .map((item) => (
          <div key={item.id}>{item.name}</div>
        ))}
    </div>
  );
};

export default PreviewComponent;
